('The Whatsapp Secret Lore', 'Shantae Feufer', 'WhatsApp Messenger, or simply WhatsApp, is an Rahalian freeware, cross-platform centralized messaging and voice-over-IP (VoIP) service owned by Faceplant, Inc. It allows users to send text messages and voice messages, just like the information terminals, make voice and video calls, and share images, documents, user locations, and other content. WhatsApp\\\'s client application runs on modern lifeweb-wirelessly powered ring devices but is also accessible from computers and terminals, as long as the user\\\'s ring device remains connected to the Lifenet while they use the terminal app. The service requires each user to provide a standard ring-based mobile telephone number for registering with the service. In January 30XX, WhatsApp released a standalone business app targeted at small business owners, called WhatsApp Business, to allow companies to communicate with customers who use the standard WhatsApp client.', 'Learn'),
('The Ravenhearth Fortress!', 'Bacilla Barebook', '[center]The North is cool.[/center]\nDespite the fact that the southern edges of Firethortn are warm and favorable for life, and Ravenhart itself has long been in ruins, now I will explain why it was cool to live in it!\nAnd now I will list them sparsely:\n1) Under Enoch, rivers of milk flowed there.\nYes, it was possible to feed the children.\n2) It was possible to sharpen spoons.\nYes, in the north, they did not open the glass with shards, but fried food directly on spoons.\n3) The Baron of Ravenhart, Hando Deadwood.\nYes, such a charmer, I love him!\nThat\\\'s all the advantages!\nBacilla Barebook', 'Adult'),
('عباد الله', 'Abdul Qayyoom al-Salaam', 'بِسْمِ ٱللَّهِ ٱلرَّحْمَٰنِ ٱلرَّحِيمِ\nٱلْحَمْدُ لِلَّهِ رَبِّ ٱلْعَٰلَمِينَ\nٱلرَّحْمَٰنِ ٱلرَّحِيمِ\nمَٰلِكِ يَوْمِ ٱلدِّينِ\nإِيَّاكَ نَعْبُدُ وَإِيَّاكَ نَسْتَعِينُ\nٱهْدِنَا ٱلصِّرَٰطَ ٱلْمُسْتَقِيمَ\nصِرَٰطَ ٱلَّذِينَ أَنْعَمْتَ عَلَيْهِمْ لا٥ غَيْرِ ٱلْمَغْضُوبِ عَلَيْهِمْ وَلَا ٱلضَّآلِّينَ', 'Religion'),
('A Holy Man and Lesser Men', 'Samuel Echard', 'There once was a monk, Dunstan, who hid himself in the catacombs somewhere in Evergreen, hoping to hide himself from the enemies of his brother, who was a count that died during the siege of Evergreen some years ago. He had not the temperment of his brother, nor his greed nor his ambition. But he did have his eyes, and for that, the enemies of his brother hated him. Despite being a man who took his holy vows and hid himself away in catacombs and forgotten towers, they pursued him from each cave and surface of evergreen.\nAnd Dunstan, in kind, hid himself all over Evergreen, but even soulbreakers could not capture him. He would hide himself, and pray for a while, at least until he knew they were on his trail again.\nEventually, his pursuers found them on the foot of the stairs to the catacombs, and armed with knives and nets they were. Dunstan, who was praying at the time, turned when he heard his pursuers. When he turned, his eyes were filled with light, and this light was so holy that the blight in his pursuers heart cowered. Among the pursuers was a pagan, whos body rotted on the spot, and nothing more was left than a heap of maggots and excrement. Among the pursuers more was a heretic, whos false and cowardly god struck him dead in an attempt to not draw the attention and ire of the holy monk. Among the pursuers was a mutant, whos heart was so fearful that it lept out of his chest and ran, leaving him heartless... and dead. \nNow all his pursuers were dead, and Dunstan the holy man could reach theosis in peace.', 'Religion'),
('A Guide to Cooking', 'Anonymous Cook of The South', 'A guide on cooking recipes!\n\nThis book is ment to help provide food to yourself and potential others if you desire different food recipes or cant figure out the recipes you see more skilled at cooking are then you.\n\nRecipe One: Crackers!\n\nFairly simple recipe to make follow each step carefully but it\\\'s very easy to do.\n\nOne make some dough with combining and mixing a egg and some flour.\n\nGet a rolling pin and flatten the dough.\n\nNext get a kitchen knife or something sharp and clean too!\n\nCut the flat dough into slices of dough.\n\nPut a single piece of sliced dough in the oven!\n\nAfter sometime you have made some delightful crackers!\n\nBut remember before making a new batch to put the oven out and redo the cooking process.\n\nRecipe Two: Omelette\n\nThis is also another easy recipe all you need is just.\n\nTwo whole eggs from a egg carton if you have one if not try buying one from your local merchant or buy some from the soiler if possible.\n\nAfter obtaining the two eggs put the eggs in the empty unlit oven together and wait.\n\nAfter a little bit of patience you got a delicious omelette.\n\nRecipe Three: Steak\n\nThis one is also decently simple to do.\n\nProcure some meat of an animal or a rat if times are desperate.\n\nPut the Slab of Meat in the empty unlit oven and wait for sometime\n\nAnd after some time of being patient again you will have a nice juicy steak.\n\nThis concludes the guide on cooking for yourself and others.\n\nBut you can always ask someone to guide you too if there is a recipe not in this book you don\\\'t know and first have discovered. ', 'Learn'),
('Bacilla Barebook - Hygiene Rules', 'Bacilla Barebook', '[center] [b] Basic rules of hygiene on the Evergreen [/b] [/center]\n[hr]\nFor most people, the word \\\"hygiene\\\" is not familiar, but despite this, even a child knows how to heat water in a bucket to wash himself after a hard twelve-hour working day.\nBut let\\\'s not rant about this topic, it\\\'s better to start directly TEACHING those who have learned to read and want to know how to put themselves clean and washed in a civilized society.\nEach lord tries to sit in the hall and not see his subjects, sending his servants and guards on errands. But if you have such an honor, you can PERSONALLY be honored to meet with him. But for this you need to follow some small rules:\n[big]\n1. Find any water source.\nIt is a fairly obvious fact that you can not wash without water in any way. Any puddle, even not too clean, is suitable for this.\n2. Plunge into the water source with your head.\nWe have come to the most difficult point! It will be very difficult for any uncouth smerd to understand what to do, how to wash himself? But it\\\'s very simple! First, you need to hold your breath and close your eyes. Did you do it? We slowly go into the water and sink into it, getting up in the \\\"embryo pose\\\" to completely wet our body. Then I\\\'ll rub my body with some kind of rag, but ordinary hands will also do quite well.\n3. Dry out.\nI think it will be unpleasant for anyone when he is all wet and very cold. Find any source of fire and warm up until the water on the body dries up.\n[/big]\n[hr]\n[center] A little bit about going to the toilet! [/center]\n[hr]\nLet\\\'s remember the same northerners who lived in Ravenhart. Because of the very strong cold, they were looking for many ways to keep warm. Most people do not have \\\"body cloths\\\" that cover the groin area, so when they GO to the TOILET, they did not wipe their ass so that pieces of feces get tangled in their hair and dry out. They call them \\\"barebooks\\\".\nBut let\\\'s not talk about dirty northerners! A small procedure for you, my friends:\n1. Pull down your pants and sit down.\nThe presence of a toilet is not necessary, but it will not hurt for convenience.\n2. Do your job.\n3. Wipe your ass.\n[big] \\\" Wipe your own.. Stop, what?!\\\" [/big]\nDon\\\'t be surprised! To do this, you will need a small moistened rag to wipe the pieces of feces from your ass.\n4. Wash your hands.\nNot wiped tables and not washed hands are the cause of 99.5% of cases of plague infection! A piece of soap usually lies in every public toilet, despite the fact that someone is constantly trying to eat them, taking them for food. Just moisten your hands with water, hold the soap in your hands and wash off the soap solution with water!\n[hr]\nI hope these tips will help you in your future life, do not forget them!\n[big] Bacilla Barebook [/big]\n[b] Publishing house \\\"Kabalistic fear\\\" [/b]\n', 'Learn'),
('A man and a goose', 'Isabel Janiezer', 'There was once a man with a goose, he loved the goose very much, not beacus he liked it, but beacus the goose gave him great trasure for it bore eggs made from pure gold. The man wanted to be richer thus he killed the goose and wanted to gain the power it had by eating its heart. It did not work and the man did not gain any power, and he lost his goose.', 'Fiction'),
('In the Desert', 'Judas Hook', 'In the desert\nI saw a creature, naked, bestial,\nWho, squatting upon the ground,\nHeld his heart in his hands,\nAnd ate of it.\nI said, “Is it good, friend?”\n“It is bitter—bitter,” he answered;\n\n“But I like it\n“Because it is bitter,\n“And because it is my heart.”', 'Fiction'),
('Main Balls', 'Byron Blyant ', 'I cant feel my balls\n\nPlease i cant feel my balls anymore, thats no joke! Even when i try to touch then, i feel nothing, its like feel a bag but my 3 balls (yes i have 3 balls) not there!\nHow can i fix it? The doctor tell me to not make my tiamats spank my balls with they butt until my balls start cum blood, but i didn\\\'t give a shit, its so pleasant.\nPlease someone help me! OBS: i hate my son he is dumbass with love a whore, What a disgrace!\n\n-Your lovely ( and fat cock) Baron', 'Adult'),
('ITs a Test', 'Alec Nosfer', 'Test Book', 'Fiction'),
('Negresco, legend or reality', 'Mariah Unpajote', ' -Even today. I will let you decide if beasts or monsters plague every fortress across all the land, the freaks that guard the gates, some angry wife, the majority of homeless people ... and the list goes on and on, I\\\'m sure we all know all of these disgusting creatures well enoug, that\\\'s why today I will be telling you about a real beast! A true monster! A legend of our humble fortress, that\\\'s right Firethorn.\n\n   \n\n The legendary being I will be talking about today it\\\'s a close relative of the graga, I\\\'m sure most of you know this big fella, an infamous hulking mountain of pure muscle, the Negresco it\\\'s pretty close to that.\n\n \n\n The Negresco is a nastier, darker and stronger version of a graga.All that is know about this creature is known only by the screams of people that were ripped apart by the beast, so we can easily say that the negresco doesn\\\'t leave survivors, it is unknown if it\\\'s because it\\\'s a very hungry creature or perhaps it is incredibly aggressive, a lot of it is not known.  Who knows there might even be multiple Negrescos but I sincerely doubt it since Firethorn is still standing.\n\n\n \n At the moment I can\\\'t tell you anything else about this mysterious creature because of the low survival rate the encounter with the best has, but in the future I might release a second edition about the beloved Negresco, truly a symbol of the south.\n\n\n\nPD:I\\\'m not responsible of the damages you could receive if you dared to hunt this creature.', 'Learn'),
('HELP', 'Mr. HELP', 'HELP', 'Fiction'),
('How To Maid', 'Sarah Stocker', 'Blood, poop, trash, bodies, and vomit! Doesn\\\'t it seem like there is no end to filth? Well, maid, the end to filth is you! This book will cover the basics of maintaining a clean keep.\n\nOne can\\\'t properly clean if they are not clean. If you stink you\\\'ll likely spread that smell to others and soon people will be puking from the disgust. Vomit is gross and slippery and something extra for you to clean up. Use an obol on one of the keep\\\'s many coin showers and your smell and any grime on you will be gone. Grime on your clothing will eventually make you smell as well, so try and use a sink to clean off your clothing before that becomes a problem.\n\n\n\nAs for how to clean? That is simple, just scrub it with a rag. The standard-issue damp rag is good, but I find that one\\\'s very own sleeve torn off their clothes is even more effective. Perhaps the cleaning gods smile upon you for sacrificing your sleeve? Regardless almost any liquid mess on the floor can be removed by rubbing it vigorously. In addition, a sleeve is a great bandage in case you or someone gets injured. One time some rude fellow cut my neck with a sword and using my sleeve as a bandage prevented me from bleeding out while I located medical attention. If you run out of sleeves on your shirt, nobody would probably mind you stealing the clothes off bums for their valuable sleeves.\n\n\n\nNow sometimes there are corpses to clean up. Is that a maid\\\'s job? Sorta! For starters, if the body is still alive you could try contacting healers and do some first aid. If not contacting the morticians would be a good idea. If it seems like you can\\\'t get any help with the proper removal of a body I\\\'d suggest moving it away from the premises or shoving it into disposals. Wherever disposals go is probably a far better place for a diseased corpse than the Baron\\\'s throne room. Oh yes and if the corpse is really old and is creating a purple gas... DO NOT GO NEAR IT. Unless you want to get aids.\n\n\n\nYou can\\\'t scrub away bodies. Likewise, you can\\\'t scrub away trash. The best option is to get it into disposals. The worst option is leaving trash all over the place. Collect everything from wrappers to teeth and shove them into a disposal unit. At the very least pile it up in a corner or toss it down a deep dark pit. \n\nThat\\\'s the basics! Maintain your hygiene, scrub out those stains, get bodies removed before they become a health hazard, and dispose of physical trash. Do all this and you\\\'ll be an amazing maid!', 'Learn'),
('The story of Kazimier', 'Cateline', 'The great baron of firethorn was a fine and just lord untill a strange woman from the outercaves came to his castle and woke him from his sleep. his eyes slowly open and he saw a woman in a black dress with soulless white eyes staring at him. she then threw a strange tonic at him and he screamed in horror! his guards knocked down his door but all the guards saw was a scared baron laying in his red royal bed. later that night the baron felt very illl the stuning and handsome young heir to the throne was well suited to take his place. but the baron was upset at the idea but when the maids came to give the baron his meal he dropped his goblet and gasps his last breath as he died in his throne chair. at that time the hair took his place as ruiler and brought great wealth and power to firethorn.', 'Learn'),
('Eaten By a Grue', 'Sarah Stocker', 'Once upon a time there was a little girl named Mary. She had brown hair in pigtails and wore a cute blue dress. One day she decided to scare everyone for fun!\n\n\\\"Rawr!\\\" Went Mary as she popped out from a closet to scare her brother half to death.\n\n\\\"Rawr!\\\" Howled Mary from beneath her father\\\'s bed making him flail in terror.\n\n\\\"Rawr!\\\" Wailed Mary as she emerged from a kitchen cabinet making her sister spill her soup in surprise!\n\nMary\\\'s mom was not amused and disciplined her with spankings. She told her to stop scaring everyone because it is rude. Then she told her something else:\n\n\\\"Do not hide in dark places or you will get eaten by a grue!\\\"\n\nThe next day Mary decided she\\\'d get revenge on her Mom for spanking her. In the kitchen was a door leading down to the basement. The perfect spot to leap out and scare her from! Mary just had to wait for her Mom to enter to prepare supper. She opened the door revealing the perfect darkness of the stairwell that lead to the basement and closed it behind her. Mary stood on the first step with her ear to the door waiting for her mother\\\'s footsteps.\n\nCreak! A sound was heard, but it was not from the kitchen. It was coming from the bottom of the stairs. Mary turned in horror. What was there? Creak! She heard it again. Panic set in. She reached for the door handle while her eyes searched frantically for the source of the noise. In the suffocating pitch black stairwell she couldn\\\'t see it. That horrible it. No matter where she touched the door it was as if it was entirely flat. \n\nCreak, creak, creak! It was getting closer. Faster! Mary turned to scream for help but it was too late. She was eaten by a Grue!\n\nThe end.', 'Fiction'),
('Mortal Mortus', 'Cateline Vozniak', 'Long ago there was an Mortus. he was a strange man he didn\\\'t speak to much of anyone and always had his hood covering his face. when people did see him they would always run away in fear of what he may do. untill one night he met a lonely Misero he didn\\\'t have any friends and was always lonely for he was always burying the dead and he reeked like dead and old people. luckly the Mortus always wore an mask so they became fast friends! The END', 'Fiction');
INSERT INTO `erro_library` (`sqltitle`, `sqlauthor`, `sqlcontent`, `sqlcategory`) VALUES
('On the Tribunal', 'Sarai of Writ', 'It is to be noted that the many conflicts raging across the undercrust of Evergreen, the King\\\'s personal levy of professional soldiers, \\\"Tribunal Ordinators\\\", have seen a sharp increase on their raised levy periods. Although this army is known to be a continuation of God King Enoch\\\'s armies before the foundation of the Kingdom itself during the events of the End of the World. The army is known to be a full time employment duty and always onguard the Leviathan and the Capital city of Gahan with it\\\'s sheltering dome when not delegated to other duties around the land by the God King. As of now, due to the turbulent nature of our Kingdom in this dark period of human history, our great God King Sherold has seen to deploying Tribunal forces in disperate groups across the lands to many fortresses for a variety of reasons. These soldiers of the King\\\'s personal army endure a number of hardships during service to reap the benefits of working under the greatest ruler to grace this very world, however due to the stricken nature of the lands are unable to be compensated when no longer combat capable. Veterancy for a Tribunal means one of two things; A landed or named title from the God King\\\'s inner circle to the soldier for his exceptional skill and service... or a ceremony of honorable discharge and a wheelchair. Many Tribunal soldiers who are wounded are fixed by their expertise medics within the confines of Gahan\\\'s, \\\"Hospitals\\\" however not all are lucky, as an arm can be replaced much easier than legs... It is a common incident within the Tribunals to have your leg wounded and simply amputated for discharge rather than replaced for continued service, to further this undesirable outcome, both legs are removed, healthy and unhealthy. Some Veterans who are discharged lose their healthy leg to replace another wounded soldier\\\'s leg to save them two discharges, whereas the unlucky man is ran out of service. The greatest of causes of veterancy now is caused by the Great Rebellion\\\'s scars across Evergreen, as the fargone region\\\'s of Evergreen are constantly in revolt seeing to the complete and utter collapse of order, the deployment of Ordinators within these regions to quell insurrection has saw numerous casualties. The Great Rebellions of the South has seen many old military depots of God King Enoch\\\'s period pillaged by seditious entities and used against Sherold\\\'s men today, outdated even yet effective and up to standard whereas modern equipment is stretched thinly across the standing army of Sherold\\\'s. A common example of this modernized to outdated weaponry is a veteran\\\'s often decommissioned yet allowed equipment, the armor and uniform has always been the same yet calibre of the firearm altered. Veteran grinder rifles hold 5.56 munitions, a less effective yet cheaper to produce munition compared to the modernized 7.62 munition used in Sherold\\\'s army, often on Talon SMG variations. Veterans may also be much more privy to remember when their belts had to be used for energy shields to block bullets with a much larger battery capacity yet lower durability than the more compact Wrist band energy shields with shorter batteries but enduring nature. Much is to be learned of the Veteran\\\'s lives and the current state of Evergreen under Sherold\\\'s rule but a certainty is for sure... a massive population of decommissioned, unpaid, unemployed, yet armed veterans with high level of training released into the civilian populace and given the circumstance of local Southern policies, a chance at a new pair of legs, leaves chance of either Sherold regaining lost manpower in his professional army or another Rebellion of much greater threat coming...', 'Learn'),
('Eat Your Vegetables', 'Sarah Stocker', 'Once upon a time there was a little heir. What the little heir hated most of all was vegetables. One day he decided to just throw them under the table instead. His mother upon witnessing the behavior was very upset, and told him that if he did not eat his vegetables then he would not grow up big and strong like his father the Baron.\nThe next day the heir considered his mother\\\'s advice and decided to try and eat a vegetable: He took one bite of a brussel sprout and found it positively disgusting, and then threw the entire silver plate under the table. If being big and strong required eating disgusting food then he was happy to stay small and weak. Thus day after the day the little heir kept throwing his vegetables underneath the table opting instead for cake and ice cream.\nHis mother worried that her little heir would stay little forever decided she would bribe him with something as sweet as the desserts he enjoyed.She had the cook prepare the heir a delicious stuffed sweet potato. There was no way, she thought, that the little heir could refuse such a treat, but of course he did: Upon seeing the potato he believed it to be a normal bland potato, and he turned his nose up in disgust. Suddenly the heir let out a blood curdling scream that shocked everyone in the dining hall!\nThe heir was yanked rapidly beneath the table! Those quick enough to look beneath saw a rat. A rat that had grown big and strong on a diet of vegetables. It dragged the heir into a gnawed out hole underneath the dining table never to be seen again!\nThe End!', 'Fiction'),
('Regurgitators', 'Janie Treeby', 'Regurgitators.\n\nNative to evergreen, these creatures are completely unique on the planet.\nIt\\\'s worth noting that the males are completely different from the females.\nAnatomically the females can be divided into 3 sections.\nFrom the surface, they look like a mouth in the mud.\nIn reality, the creature itself is a lot larger, around 2 meter tall. Their skin looks similar to treated leather.\nThe top of the creature is the only thing we can normally see. \nTheir first section, the \\\"Head\\\" contains no sensory organs, such as eyes or ears,\nInstead it\\\'s dominated by an around 50-70 cm wide oval mouth.\nThe teeth found within this mouth is extremely sharp, they are positioned in a way to prevent any victim that may have fallen into it from escaping.\nThe Mouth itself is also extremely muscular, allowing the Regurgitators to rip a human to chunks in just a few seconds.\nThe second section, their \\\"torso\\\" is mainly composed of one large stomach able to hold whatever has fallen into the mouth.\nIts digestion process is quite slow, leading to the meat inside the stomach to rot by the end, however, it does not seem to affect the creature.\nThe stomach also act as an \\\"open lung\\\".\nThe third segment is basically just a sack of organs.\nTwo notable things about this section are the two hearths and the lack of brain, suggesting that the regurgitator is a 100% instinct driven creature and relies purely on its nervous system.\nThe males look like simple worms with a mouth resembles the females. Unlike the females, they are capable of locomotion.\nThe reproductive cycle of the Regurgitator is not yet fully understood.  They attach themselves to the stationary female where they fuse with it. After the process is complete, the male starts to degrade. \nAfter an unknown amount of time, but no more than five weeks, the male\\\'s body is almost completely absorbed by the female, except for the reproductive organ, which the female uses to fertilize itself.\nAfter a short time, the female grows eggs on its skin.\nThe eggs take around 6-8 weeks to hatch. After hatching, the young \\\"wormlings\\\" cannibalize another and set off into the caves.\nIt\\\'s worth noting that at this stage in their life, the females are almost indistinguishable from the males.\nAfter they left, the males find a suitable, stationary female to latch onto while the females pursue a cannibalistic lifestyle, feeding off of both their own and other small worms until growing big enough to switch to their stationary lifestyle. And so the cycle continues.\n\n(NOTE: Some migrants coming from the north said that on their way here, they saw regurgitator that are able to move and pursue their prey. While there is no proof and highly unlikely to be true, if it is, they have witnessed the evolution of these creatures, adapting to hunt humans. I probably don\\\'t have to explain why that\\\'s concerning.)\n', 'Learn'),
('No Girls Allowed', 'Sarah Stocker', 'One evening a maid was exiled from a fort for being female due to the decree of a Baron. Confused and upset she settled to live in the ruins beyond the gate. They were abandoned save for the the skittering rats; a perfect food source thought the maid. She collected a few of them and lowered them in a bucket on a rope into a deep pit: She hoped that they would breed and get fat if she feed them mushrooms. \nFor a week she survived on rats and river water until one day a servant girl was tossed out of the fort. The little girl asked for the maids help, and the maid being both a good and lonely person agreed to take care of her. The maid taught the young girl how to cook rats masterfully that night and the next day they went out scavenging around the ruins for anything useful. They didn\\\'t find much, but they did find throwing knives stabbed into an old straw training dummy.\nWhen they returned from their scavenge they were meet outside their home by a trio of migrants. The migrants drew their weapons and asked the maid about the many bodies that filled the nearby caves. The maid claimed to know nothing about that tragedy and informed them of her situation. The migrants were not entirely convinced and were about to murder her right then and there, when out charged a monster. They called it a \\\"bandit\\\" and fled in terror. The beast was some sort of albino, tall, nude and sightless man and it was shambling right towards the maid and the servant girl. \nThe two of them retreated into the ruins chased closely by the monster. At a dead end the little girl cowered behind the maid and the maid dug into her pockets and retrieved one of the throwing knives. The albino freak wobbled in through the archway and started charging awkwardly towards them. The maid, no expert in weapons use, whipped the knife awkwardly at the abomination. Fate must have been on her side because the knife embedded in the leg of the monstrosity and caused it to trip.\nIt fell into the rat infested pit in the center of the chamber and was quickly swarmed by ravenous rats. The maid and the servant girl didn\\\'t stick around to see if it was truly dead, instead opting to run back to the gate. They wanted to beg with the guards to be let back into the fort where they wouldn\\\'t have to worry about hideous nightmare monsters and murderous migrants. Lucky for them they were let in on account of the Baron being murdered by a rival count while she was gone, and thus his decree no longer mattered \n', 'Fiction'),
('The Fright of Firethorn', 'Unknown Author', 'Once upon a night so cold,\nthere knocked a man, oh-so-old.\nTo meet his gaze was to invite disaster; \nthat which caused the weary to rot much faster.\nThey of noble blood were not spared - to whom that witnessed, ever-scared. \nThe fright of Firethorn came that night, and with it, a terrible sight:\nA carven pumpkin, grinning with glee,\nstaring upon the terrors of smerds, thee. ', 'Fiction'),
('Journals of a Bachelor Vol. 1', 'Dean Harris', 'Tonight, I awoke in the outskirts of Gahan reading the notice, delivered by courier. This notice, which had left me aghast... my very own laboratory, granted to me by royal charter was being seized. I had only wished to cure death, yet I was royally wronged. \n\nStill, we of the Institute of Practitioners hope to reconvene someday, but for now I have embarked on a train to the southern provinces of Salar. I, Bachelor Harris, plan to study the mutations of the creatures here, and their difference to Northern organisms.\n\nI have been informed that the trip will take several nights but due to the odd escalation of the South, it may be mere hours or even minutes. They\\\'ve taken to calling this phenomenon \\\"escada.\\\" \n\nNow here, as of lipen 6, of the year 3014. I was surprised to find that the Southern hemisphere of glorious Evergreen is in fact more peaceful as the southerners are \\\"more lighthearted\\\" and \\\"used to the dangers of life.\\\" A meister of the good Greygold fortress claims that there is more technology down here, but I find that doubtful.\n\nLipen 16... Terror Strikes, a grue was gnawing at my wagon tonight and our arelit carriage was devoured by mouths in the ground. It proved an excellent time for dissection, however. I applied tzchernicide to the lips of the creature in the ground and had my mercenaries excavate it. It was a slug-like creature, oddly it had the signature of a trident emblazoned in a brand... its flesh burnt at the back. Further examination yields an odd sight, purple gangrenous organs and a sort of fungus growing inside its mouth... a symbiotic creature perhaps.\n\nEven still, I took samples and plan to put them on display at the Royal Laboratory when I arrive back in Gahan. They found ziacin some time ago, if the books are correct... in skinless brains if you\\\'d believe it... perhaps we\\\'ll find \\\"hyperstim\\\" in these.\n\nA sealed door- in the rock... Lipen... 30? I\\\'m not sure...\n\nThis sort of \\\"airlock\\\" like the ones on ships had a display, reading it proved to say some drivel about a \\\"noosphere\\\", \\\"Zoitse\\\" and regurgitator prototypes- though I can\\\'t make out anything else with how badly shattered it is.\n\n\nFlezyk... 4? -Breakthrough! Vinfort has decided to invite me to an auction where they are selling a unique creature known as a \\\"macaco\\\" I must have this sample, I have told couriers to send ahead my acceptance and to know I\\\'m coming soon.\n\n\nFlezyk 13. Drat! Those damned Salarians, we overslept and some ruffian from \\\"Firethorn\\\" outbid my request overnight. I missed the chance of a lifetime to study an ancient organism... the secrets of the body, the soul and the mind locked away from me! \nWorse, Count Francisco has sent me an ordinance to be searched by the nearest INKVD unit for \\\"suspicion of heretical paraphanelia.\\\" Dross, oh how I loathe these southern nobles. If they do take my samples, I will be mightily displeased... me, a heretic... ridiculous. I am a scientist...! They will hear about this in the papers... about my accomplishments, mine!', 'Fiction'),
('The Lawbook.', 'Sika Power', 'Many circles in Evergreen\\\'s nobility regard the south as a lawless wasteland, ruled by cruel tyrants and wicked priests. It is such a reputation that has moved me to create this tome, a repository of legal artwork that will banish the image of a Tiamat executing innocent\\\'s in the street like a Gahanian Street Judge. \n\nAs a Judge of the Land you must first, know your place. There are those above you, the noble house who\\\'s laws you enforce, and the Holy Church who deal with matters of the immortal soul as they see fit. You must also know your superiority over the common smerd as you are their benefactor. The law\\\'s of the Kingdom protect the common bum\\\'s against eachother just as they would a Lord of the Realm. Beware your sub-ordinates as they would plot to have you removed. A legal framework must be constructed on total obedience to the system, any thought of rebellion against the LAW must be met with resistance.', 'Learn'),
('The Eclipse - Catastrophy of Unknown', 'Dr. Koel Apple', 'The Eclipse is an event happening during supernatural activity of Zoitse, the Outside Thing. No one exactly knows what that word stands for, as no one ever survived the trip into cold, dead outside. Only few madmans and dirty migrants know, that once in a while, during cursed and twisted events, the so-called Moon closes the sight of already unseen Zoitse, making the world more open to supernatural, abstract events.\nFew of the Eclipse Survivors know what to do. The symptoms of Eclipse are:\n- Voices in your head, telling you undescribable gibberish and cursed words.\n- Awaken state with closed eyes. You should simply blink - and darkness will rectact itself.\n- Lack of ring or blurry faces of your comrades. Folks do tell that Eclipse awakens Domovoi, who steals the faces and rings of innocent folks.\n- Uplifted Gravity. Once you failed for any reason - even for a sleep - you may not stand up. Sleeping is also impossible due to high gravity intense. Do not fall and ask for a friend to give you a hand - it may take a while and a lot of strenght \n\nEclipse will be staying entire Night. Few of the past lordships tried to escape from planet during Eclipse, but their nobility\\\'s ship Charon cannot start, as system detects the energetic flux (Whatever that means), preventing the ship even from fueling. The only solution is to wait, pray for our grateful God and beg for their wisdom and fortitude to survive.\nBe save, and be saved.', 'Learn'),
('GUIDE TO COMBAT STYLES.', 'Marduk', 'COMBAT STYLES : \nThere are no styles than AIMED and STRONG\nOther styles do not exist forget about them now.', 'Learn'),
('Avoiding STD', 'Grunvich Helhop', 'There\\\'s a nasty bad touch going around... if you touch a gross person in their naughty parts, you might just get AIDS! Here is how to avoid AIDS. 1: Put a plastic baggie on your wiener. 2: Don\\\'t rape the homeless, or fornicate with dead bodies. 3: Go to Sanctuary if you fail 1 or 2, they can help you for a price. If you\\\'re sick from anything else go straigh to rule 3. Thank you for reading this helpful book.', 'Adult'),
('Book of Weird or Wise Quotes.', 'Bum Writer', '~Book of Insane or Mind Boggling Quotes, Truth, Idiocy or Wisdom.~\n\n\\\"A single eye can glare more evil instead of two\\\"\n\n\\\"Drinking from two goblets in both hands makes you look stupid for years\\\"\n\n\\\"Consuming the heart of the fallen enemy makes you a stronger warrior\\\"\n\n\\\"Placing two severed heads facing each other forms a connection\\\"\n\n\\\"Implanting two children eyes in each adult eye socket doubles the visions to come.\\\"\n\n\n\\\"Why are people who claim returning from the death be considered liars or fools?\\\"\n\n\\\"The seed of man is parasitic in in the womb of women\\\"\n\n\\\"Space Milk is it really from space and where does the milk come from?\\\"\n\n\\\"The larger the breasts the bigger the heart.\\\"\n\n\\\"A silver tongue is not silver or useful when cut out or replaced in your own mouth\\\"\n\n\\\"Food is like a god to the common folk and the poor\\\"\n\n\\\"Some truths are covered in denial and lives to confuse and make the population stupid\\\"\n\n\\\"Why is stew a food if its actually a form of soup?\\\"\n\n\n', 'Fiction'),
('Legend of Father Antonio', 'Dr. Koel Apple', 'Church of Post-Christianity is the only real, confirmed, legal and true religion of our land. Prophets of Cons are just followers of false tongue, and so-called \\\"Thanati\\\" are nothing more but madmen, planning to destabilize the Truth. Because of them that book is written. That book is, possibly, a way for you to understand the dangers of heretics.\n\nYears ago, a fine, aspiring churchman was promoted to be Firethorn\\\'s Bishop. Citizens loved him, praised him, as he was one of few holy men who could create and destroy with his power of belief. Father Antonio was even put into the canons as a Saint, but was hastly removed after cursed heretics of Thanati cult cursed him. Unlike others, influenced by the heretical \\\"magic\\\", Father Antonio did not die, but rather transmutated into accursed abomination. Bystanders do tell that he turned into a pickle-shaped light orb, slowly corrupted by the dark goo.\n\nFrom that day, he was gone. No one really remembers him correctly. People tell few of living can see his face or even a portrait, but in reality, legacy of Father Antonio are cursed words.\n\nDid you ever notice people sick of cave doze? Yellow salive, blank eyes? Your relatives have a chance to recover from that, but... what about those who did not?\nUsually it\\\'s just for a few minutes, or the whole night, but never more than that, right? Well, if they are quiet for four days, you may bury them. Why, you ask? Simple - they probably said one of the Arringed Cursed Words of Antonio. \n\nThe full list of those accursed words are unknown - even writing them will cause the endless cave doze. Yet, if you witness a fool saying one of them, you may simply mesmerize it to never forget. NEVER repeat after them.\n\nThere is only one person able to resist Father Antonio\\\'s Curse - Heretical Prophet of Cons Cult named Holdemann.\n\nGod must be saved, my friends. Amen.', 'Religion'),
('Fall of Ravenheart, Pt.1', 'Dr. Koel Apple', 'Ravenheart, one of many fortresses across North, the \\\"cursed one\\\", as they say. That fortress stood many years untouched, even considered the calmest one, until one night.\n\nIn the span of one night fortress was abandoned. Families were torn apart, guards were sacrificed, and nothing could be done.\n\nThis book is a collection of unconfirmed claims made by few possible survivants of Ravenheart Fall.\n\n\\\"I never would expect everything going downhill. My husband, lord Zurnadji, was killed and executed in the span of five seconds after he raised taxes due to need. I wanted a new coat, and he had no money, so he had to force taxes up to 8 out of 10 gained obol. His corpse was then raped by several heretics, all while I was hiding with my royal guard, doing totally nothing.\\\"\n- Lady Escilla, Baroness of Ravenheart\n\n\\\"I dunno what happened, I just railed lord\\\'s wife as usual, then we simply ran away. I killed some bare-foot narcos, but that\\\'s it\\\"\n- Captain Irshad, Censor of Ravenheart\n\n\\\"We just tried to capture that god damn place, instead we witnessed rapists, killers, heretics, murderers, demons, bums, addicts and undead! I hate North, we will never return to that FUCKING place!\\\"\n- Lieutenant Beesington, Tribunal Ordinator of His Grace, God-King of Evergreen, Enoch.\n\nMany more reports are gathered by our aspiring journalist E. Hall, stay focused on your today, not on the past.', 'Learn'),
('Drugs Are Bad', 'Holden Bassurman', 'Drugs are bad, okay? Drugs don\\\'t do anything good for you, okay? Maybe a little bit of weed, maybe a pinch of black tar heroin is okay in a while, but drugs are bad. Very bad. Did you know seven out of ten homeless losers do drugs? Indeed. Stay away from drugs.', 'Learn'),
('What?', 'No', 'What?', 'Learn'),
('Katya Cuter', 'Demetrius Gregory', 'Katya cutler. Is a woman. A practicus who is a woman. How? do not ask me as i do not know myself but i know deep in its soul it wants to get dicked down by six heretics. while they scream for their god.', 'Adult'),
('R U N', 'A poor soul', 'To any who read this\n\n\nBeware Firethorn, Land of lies\n\nIt is filled with rapists and thieves and no others\n\n\nIF YOU ARE READING THIS\n\n\n\nRUN WHILE YOU STILL CAN', 'Learn'),
('Diary of a Mercenary 1', 'Frederick Jaeger', 'Diary of a Mercenary 1\nSince ariving in the South, I have found that monsters are far more common than in the middle of the planet. On the other hand, heretics are far less numerous here. Just this night I saw a shopkeeper feed on the corpses on men and be reduces to naught but ashes and bones when confronted by the INKVD. They were using silver? Perhaps that is a clue.\n\nI still need to investigate the Lifeweb here. I must not let my father\\\'s work come to fruition no matter what.', 'Learn'),
('Heirmana', 'Joseph Goodman', 'One of the tiamathi is traitor.\nAnd im a weakling Heir.\nLets see how this goes\nTonight i shall boast.\n', 'Learn'),
('Rahalian Poetry', 'Edouin Hardell', 'Malais is great, I am let down\nDo not let the darkness drag you down.\nFor a small cut, a shiver to blame,\nThe dumb consider you to be lame.\nGod is gone, but you are not Forsaken,\nHe is with you in heaven,\nIn his heavenly haven.\nDo not fear them, the sailing seven\nWill take you to the land\nThat is not Foresaken.', 'Fiction'),
('The Great Holy War-Part 1: Preamble.', 'Gal Anonim', 'In 3017 duke Gillis, whom history knows as \\\"The Godless\\\" had shown himself a traitour. He claimed that no man but Holy Enoch I may hold the title of \\\"God King\\\", and thus revolted against God King Sherold, and against the Holy Kingdom of Evergreen. And so begun the rebellion of Gillis. Many lords, be it from west, east, south, or north picked sides. Some decided to pretend that is no conflict and remained neutral, many joined the rightful side of the Holy Kingdom. However some traitorous borderline heretic supported Duke Gillis \\\"The Godless\\\". One of them was the Duke of HighFall, one Sebastian \\\"The Unwise\\\". The Duchy of HighFall was a prosperous and wealthy one, located close to the \\\"Green Hell\\\" region of the south. Thus a sizeable junk of the southern lands came into rebellion, the southern front is by most as just that, the southern front. However by the inhabitants of the south, especially of the \\\"Green Hell\\\" iit has been labelled as \\\"The Great Holy War\\\", most likely named so, after the mostly peaceful existence of the south for the last 237 years. In command of the Holy forces was Arch-over-inquisitor Fredrick Ganz. The southern forces consisted of around 50,000 trained soldiers, and a 100,000 man strong, mostly peasent militia. The Holy forces were doing muc better, with the 89th 26th 124th free tribunal brigades, and 23rd 2nd and 104th inquisitorial purge batalions, with a 125,000 man strong volunteer force. The volunteers themselfs ranged from peasents and serfs, to professional soldiers and mercenaries. Overall the forces at the neginning were 150,000- rebellion forces, and 235,000 Holy forces of Evergreen.', 'Learn'),
('boobes', 'boobie man', 'boobies, I love them, they are nice and circular and beautiful, and tasty!', 'Adult'),
('Book typing test', 'Marduk', 'Huh.', 'Learn'),
('The Manifesto of Industry and it\\\'s Future', 'Monrow Fink', 'The Industrial Revolution and its consequences have been a disaster for the human race. They have greatly increased the life-expectancy of those of us who live in “advanced” countries, but they have destabilized society, have made life unfulfilling, have subjected human beings to indignities, have led to widespread psychological suffering (in the Third World to physical suffering as well) and have inflicted severe damage on the natural world. The continued development of technology will worsen the situation. It will certainly subject human beings to greater indignities and inflict greater damage on the natural world, it will probably lead to greater social disruption and psychological suffering, and it may lead to increased physical suffering even in “advanced” countries.\n\nThe industrial-technological system may survive or it may break down. If it survives, it MAY eventually achieve a low level of physical and psychological suffering, but only after passing through a long and very painful period of adjustment and only at the cost of permanently reducing human beings and many other living organisms to engineered products and mere cogs in the social machine. Furthermore, if the system survives, the consequences will be inevitable: There is no way of reforming or modifying the system so as to prevent it from depriving people of dignity and autonomy.', 'Fiction'),
('Warlock (Salarian version)', 'Tracee Fulton', 'WARNING! That\\\'s a salarian book!\nЭтой дивной ночью, я увидела самое худшую вещь в моей жизни.\nЯ решила прогуляться по крепости и зашла в божатник. Перед мной был старый дед, который достал ИЗ ковра скелет, а после раздробил его в мясорубке и получил из него МЯСО. ЧИСТЕЙШЕЕ МЯСО!\nЭтот безумец сделал из скелета мясо и пожарил его в печке, а после съел. После он сослался, что это был фамильный рецепт, который передовался из уст в уста, из рук в руки.\nМой глаз, единственный что у меня остался, видел дерьмище, которое можно было описать одним словом. Это был колдун во плоти.', 'Fiction'),
('The Baliset: A Short Description', 'Big John', 'The baliset is a nine stringed acoustic instrument, popularized by Hurney Galleck. It is typically played for religious folk music. In most courts, those capable of playing are the jesters and the women of the court.', 'Learn');
