('darklordchinchin', 'nekoslave', 1, 'Played bishop, added so much to the party by making people repent, having somebody to confess vices to, etc. Even is able to do tragedy well.'),
('burtyu', 'nekoslave', 1, 'Good Dreamer, roleplayed out being somewhat off, did a lot of me\'s, which also was cool.. Started talking about somewhat meta/odd subjects like TNC, repented to the Baron, then started getting Agressive. Extremely good escalation and not just going crazy at the start with Dreamer.'),
('supremememez', 'honestly101', -1, 'He decides to have my head chop off for not saving a monkey which could not be saved, this was done know that i was the one that brought him back to life 2 times during the round, i dont know what goes through his head, but he made a frag brained asshole\'s decision.'),
('supremememez', 'nekoslave', -1, 'Has recently decided to kill entire courts for the slightest of things. If a hand tries to kill him- he decides his course of action is to murder the entire court and rape the entire town. He needs to learn when to tone it down.'),
('burtyu', 'nekoslave', 1, 'Tries to be very emotive during the game, tries not to immediately go for violence and include other players, like hitmen (mercs) in their stories.'),
('soulvapor', 'bailol', 1, 'Went berserker mode as practicus against a succubus gang who was wearing the deceased inquisitor\'s gear. Came out alive.'),
('vaktus4', 'derpiestbruh', 1, 'Good migger roleplay, really fun trying to work together and calm down koepple for killing the bee man'),
('vaktus4', 'deathws', 1, 'Supported good RP establishing a lord dominion of the village with migrants.'),
('mithrastrismegistus', 'derpiestbruh', 1, 'really fun roleplay n good conversation while trying to find the bookkeeper lost in the blackout invaded by two skinless padlas'),
('honestly101', 'ashtheguy', -1, 'This guy literally ignored me for a good 10 minutes into the round as Inquisitor when i was the Bishop, so i took matters into my own hands and went to the barge, took two gas nades and told him to meet me at the church, he starts bossing me around so i tell him that i\'m the person tasked with ordering him around and that he shall be recieving 4 lashes for his brain damage, guy just noctis\'s me and drags me to the barge, chr dunks me then leaves me in there for the rest of the round lol, all of this happened not even 20 mins now.  '),
('nopls', 'honestly101', 1, 'The best god damn marduk a inquisitor can have'),
('honestly101', 'steamedcans', -1, 'This is a problem with multiple corrupt inquisitors and that they just roundstart pick anyone and make them sign avowals for free chromies or get chromie dunked/put out of the round'),
('ashtheguy', 'nekoslave', -1, 'During a story, decided to contionously have the Charon called and cancel it at the last minute multiple times. It stopped being  funny the second time. They did this as a bum to continously delay the round for no good reason.'),
('sylphyn', 'mrdbaggy', 1, 'Couple rounds ago was my characters sister as marduk. Beat up the Book Keeper because he scammed me geniunely good rp'),
('lanny', 'jdeuce22', -1, 'Sooo they randomly murdered me for existing, without giving a second of explanation, or even a moment for me to ask what they were doing, which is HORRIBLE for a Marduk, in my opinion'),
('originalkiwininja', 'ashtheguy', -1, 'Nigga joined in as inquis on lowpop as vampire Inquis and went on a rampage, trying blowing up the charon consoles roundstart too for some reason '),
('sheldonjplankton', 'jdeuce22', -1, 'Played Thanati baron, IMMEDIATELY recruited the entire garrison, and moved to RAPE (Not kill) the church, with LITTLE-TO-NO EXPLANATION (Also a piece of shit)'),
