('bonelessjuice', 'jerryderpington', -1, 'Roundstart set 100% taxes, had his meister price check the shit he was selling, and could enter the shop with all access as baron. Why the hell do I even exist as bookkeeper if some fuck like this can moonlight me harder than ss13 bruhs?'),
('demkova', 'derpiestbruh', 1, 'Good migrant lord roleplay with Ultimum the lord hand, really appreciated the effort'),
