('demkova', 'vavalor', -1, 'retarded, says a lot of dumb shit in OOC, actual autist or something, for real!'),
('demkova', 'burtyu', 1, 'Demkova is a very nice person. He is browzin da web, every day! But, seriously. Good roleplayer. '),
('honestly101', 'demkova', -1, 'Will not stop playing corrupt inquisitor to farm chromosomes, and then proceeds to spend them constantly on trapok rounds to shipost, when he isn\'t doing either of these he\'s inquisitor to kill people with little to no reason.'),
('topbirb', 'jerryderpington', 1, 'While the rest of my garrison fucked off because it was a succubus round, TopBirb stayed by my side as a marduk without going MIA. Actually fucking loyal.'),
('casings2', 'demkova', -1, 'Took over a body late in a round and kind of... just went on to curse and swear alot as a child successor role handover... Proceeded to not listen or be calm in anything despite being informed in IC that people remember them acting in another attitude, then tried to beat their own parents round end.'),
('tyranicranger4', 'mrdbaggy', 1, 'Good lad, looking to learn as much as possible about the game was fun being his teacher as Armorsmith'),
('ssix', 'derpiestbruh', 1, 'Good mortus roleplay when aliens invaded the inn'),
('bonelessjuice', 'nekoslave', -1, 'Decided to as Baron seemingly as a poschristan, go along with the Marduk to start worshipping Allah, and take over the bookies shop for no good reason. He also when tried to be stopped, would gatecrush people, including his own garrison because they weren\'t letting him be a heretic. He really needs to stop doing stuff like this that ruins the immersion of the current story, and gatecrushing people for his own pleasure.'),
('halfdan', 'derpiestbruh', 1, 'good  blacksmith roleplay'),
('deeepdishpizzza', 'derpiestbruh', 1, 'Good tiamat husband roleplay, really enjoyed the dinner with him'),
('casings2', 'darklordchinchin', -1, 'Every interaction I\'ve had with this fellow has been the opposite of pleasant to say the least. He plays the same masochistic character every single round. This player lives to make other player\'s screen\'s red. I wouldn\'t doubt if other people have already reported this guy. That is it.'),
('honestly101', 'psykerinme', 1, 'Inquishitter decided he was going to torture and murder my esculap \'\'for his own pleasure\'\' when I told him I did nothing wrong and the baron was being kidnapped. This guy i\'m feedbacking is the baron, who rightfully killed his ass for murdering people. Mad respect.'),
('soulvapor', 'nekoslave', 1, 'Had good restraint playing inquisitor when encountering a wild xomite, instead of fragging me tried to do actual interrogation and roleplay. Unfortunately I \'saw the truth\' before we could roleplay more.'),
('honestly101', 'derpiestbruh', 1, 'Good marduk roleplay, scared the shit out of me ngl'),
('omgtank3', 'deeepdishpizzza', 1, 'Nice amuser, had a good scenario where they cuddled me and let me tell all my problems to her while holding my hand and telling me everything would be alright. We didnt even have sex'),
('isaacsalvor', 'tw789', 1, 'Really experienced player, fun rounds. Showed me how to play several roles like Practi, Mortus and Tiamat. He replied to my questions in DM'),
('tw789', 'nekoslave', -1, 'Decided too, as a fellow latespawn mortii to kill me when I explained to him the other mortii died to a \'firebug\' (they thought I meant actual bug and decided I was ruining immersion), when i meant the creature. They decided to accuse me of killing the mortii and killed me. Did not make sense, as our objective was to feed the lifeweb as well'),
('derpiestbruh', 'kerststf', 1, 'Good round. Good succussy. Good bookie'),
('justinien1er', 'josephfear', 1, 'A very good roleplayer, learn a lot of thins to newbies, very funny but still RP, manage well to manage rounds'),
('josephfear', 'justinien1er', 1, 'He is a player who is often present, serious in his character, I had a lot of great scenes with him. I was able to teach him a few things about how certain roles worked. '),
('coloss260', 'halfdan', 1, 'Took baron when no one else would, preventing another painful mini-mig round. A real human bean.'),
('honestly101', 'ashtheguy', -1, 'this nigga literally went Inquisitor, rushed the den roundstart then kidnapped the scuff, tortured them or something idk then noctis\'d me and dragged me to the barge then chr dunked me to shit because ???');
